"""Embedded default piece templates used by convert.py."""

from __future__ import annotations

from typing import TYPE_CHECKING, Tuple

if TYPE_CHECKING:  # pragma: no cover - imported for type checking only
    import numpy as np

DEFAULT_TEMPLATE_ARCHIVE = """

"""

_CACHED_TEMPLATES: Tuple["np.ndarray", "np.ndarray"] | None = None


def load_default_templates() -> Tuple["np.ndarray", "np.ndarray"]:
    """Decode and return the default template samples and labels."""
    import base64
    from io import BytesIO

    import numpy as np

    global _CACHED_TEMPLATES
    if _CACHED_TEMPLATES is not None:
        return _CACHED_TEMPLATES

    raw = base64.b64decode(DEFAULT_TEMPLATE_ARCHIVE.encode("ascii"))
    with np.load(BytesIO(raw)) as data:
        samples = data["samples"].astype(np.float32, copy=False)
        labels = data["labels"]
    _CACHED_TEMPLATES = (samples, labels)
    return _CACHED_TEMPLATES
